{"title":"DShield - Actor IP Activity","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v5.json
  title: Actor Activity by IP Addresses

  // Define the data source
  data: {
    url: {
      %context%: true
      %timefield%: @timestamp
      index: cowrie*
      body: {
        "aggs": {
          "by_ip": {
            "terms": {
              "field": "related.ip",
              "size": 25
            },
            "aggs": {
              "time": {
                "date_histogram": {
                  "field": "@timestamp",
                  "fixed_interval": "1d"
                }
              }
            }
          }
        }
        size: 0
      }
    }
    format: {property: "aggregations.by_ip.buckets" }
  }
    transform: [{
    flatten: ["time.buckets"],
    as: ["buckets"]
  }]
  mark: { type: "rect", "tooltip": true }
  encoding: {

    x: {"timeUnit": "monthdatehours",field: "buckets.key", title: "Date/Time"}
     y: {field: "key", title: "Actor IP Address"}
    color: { "aggregate": "sum", "field": "buckets.doc_count", "type": "quantitative", title: "Total"}
  }
 }"}}

{"title":"DShield - IPTables TTL by IP","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json"
  title: IPTables - Time to Live by IP Addresses
  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "cowrie.dshield*",
      "body": {
        "size": 10000
        "_source": ["@timestamp", "related.ip", "network.ttl"]
      }
    },
    "format": {"property": "hits.hits"}
  },
  "transform": [
    {"calculate": "toDate(datum._source['@timestamp'])", "as": "Time"},
    {"calculate": "datum._source['related.ip']", "as": "IP"},
    {"calculate": "datum._source['network.ttl']", "as": "TTL"}
  ],
  "mark": "circle", "tooltip": true
  "encoding": {
    "x": {
      "timeUnit": "monthdate",
      "field": "Time",
      "type": "ordinal",
      "title": "Date/Time"
    },
    "y": {"field": "TTL", "type": "quantitative"},
    "size": {"field": "TTL", "type": "quantitative", "title": "Total"},
      "color": {"aggregate": "sum","field": "TTL", "type": "nominal", legend: null}
  }
}"}}

